INSERT INTO `broadcasterq` VALUES (5,1271379345,'the cook','jerome, nj','1985','why does it hurt when i pee?',1),(6,1271379418,'Andy B','Ct','1992','When will they let a straight brother drive the firetruck?',1),(7,1271391472,'Freon McAmyl','Epicenter of a molecular tornado','1985','Where are my wretched tratorous friends?  ',1),(8,1271416761,'The operator','a hobby shop, robbing it,','1982','Would you prefer airplane glue or contact cement?',1),(9,1271420602,'A Pollard','Minneapolis','\'85 SN','When is Estes starting to contribute?',1),(10,1271422218,'Jungers','Brooklyn','97 Fringe','Can we get any video coverage of the start and finish lines? The new timing system is something completely new and nobody remote can tell what they\'re actually like.',1),(11,1271422672,'Kevin K','work','95, Beta','Did Beta A Women stop in the chute? ',1),(12,1271422806,'Jungers','Booklyn','97 Fringe','... to clarify, the actual start / finish line setup ... not the actual starts and finishes of the races.',1),(13,1271422817,'Kristen L.','Boston','Î”Î¥ driver \'91-\'95','Do the buggies still use wheelchair wheels or something new?',1),(14,1271423099,'John S','Denver','94, Buggy Design Chair','Andy, great commentary.  Wish I was there...',1),(15,1271423109,'John S','Denver','94, Buggy Design Chair','Andy, great commentary.  Wish I was there...',1),(16,1271425964,'Fan of mirabella','Hill 1','Unnamed competing eng school grad','Is Michelle mirabella the winningest driver in school history?',1),(17,1271426109,'Kevin K','work','95, Beta','did mark say a beta feel good moment?',1),(18,1271428499,'Tom','Chute ','88','Can you comment on safety history and any evolution in safety coordination over the years',1),(19,1271428508,'Tom','Chute ','88','Can you comment on safety history and any evolution in safety coordination over the years',1),(20,1271428509,'Tom','Chute ','88','Can you comment on safety history and any evolution in safety coordination over the years',1),(21,1271428595,'Hoss','Baltimore','SDC 2002','you guys should play last years SDC psych video to fill some time. some good buggy footage. http://www.youtube.com/watch?v=cBCnSaU4ggo&feature=fvw',1),(22,1271431492,'Kristen L.','Boston','Î”Î¥ driver \'91-\'95','Why are there so many organizations not racing this year?',1),(23,1271433627,'Kristen L.','Boston','Î”Î¥ driver \'91-\'95','I can hear you, thanks for the update!',1),(24,1271433673,'JB','Ann Arbor MI','','If Pika spins in there reroll, are they out for finals tomorrow?',1),(25,1271434000,'JB','Ann Arbor MI','Pioneer Chair 89','I\'m a dude!',1),(26,1271434159,'Demian','Stamford, CT','Sweepstakes Chair \'94','Kudos to CMUTV,  Buggy Alumni Association (and everyone else) for awesome remote video, live updating leaderboard and all the news.  Its almost as good as being there.',1),(27,1271434977,'Bob Smith','Edinboro PA','1973 pike','good broadcast guys!!!',1),(28,1271435081,'Kristen L.','Boston','Î”Î¥ driver \'91-\'95','Great job guys! ',1),(29,1271473088,'','','','',0),(30,1271473094,'er','er','er','er',1),(31,1271507272,'JB','Ann Arbor MI','Pioneer Chairman 89','Is there a heats list for today online, for those of us not in Pittsburgh?',1),(32,1271510031,'Alan Pollard','','1985','Ask Mark What time is the SN Banquet and what is the attire?',1),(33,1271510233,'Obman','Georgia','1973 PiKA','How can there be a rivalry between someone that last won during the Reagan Admin and someone that has won 50% of the races since then?',1),(34,1271510787,'Carl','Hill 1','Visitor','When possible can you please replay the sec spokesperson comments for those who. Missed it?',1),(35,1271511416,'Steve','Hill 1','10','Correcting an error... The lounge chair pit stop last year was AEPi not pioneers',1),(36,1271511935,'John S','Denver','94','What happened to SDC B Men\'s team?  Did they get DQ\'d before the overall SDC DQ?',1),(37,1271512012,'Jour hadique','The chute','1986','Let\'s talk about wheel diameter, eh mark?',1),(38,1271512020,'Mike F','Home','SN','How does Mark go through life with such a big head?',1),(39,1271512071,'Mr Derby','Derby Land','Some Day If I Get Smart','Question for Estes:  Will the new SigmaNu rubber wheel make it way to the Ultimate Speed Challenge Soap Box Derby race?',1),(40,1271512112,'Tom','Top hill 2','86','Where are the garbage cans?',1),(41,1271512134,'Ryan sullivan','The chute','95','Tell us about the bordick/estes bromance.',1),(42,1271512316,'Spagz','My pants','','Who is your daddy and what does he do?',1),(43,1271512339,'jay m','NYC','98','Can Mark Estes do his McGruber impersonation please?',1),(44,1271512431,'Todd','Union, ME','1989','When you want to talk buggy technology it starts & ends with Miss Budweiser....\n',1),(45,1271512486,'Spagz','My pants','','Why is there a delay?',1),(46,1271512751,'felmley','in a hotel near campus','88 & 94, spirit','when was SDC DQ declared?  did they move up teams from yesterday?  (only asking for informational purposes, not that SRS women were 8th and there were multiple sdc women\'s teams in the top 6...)',1),(47,1271512795,'Future Freshman','Hong Kong','2014','Hi, i\'m a future freshman and i know very little about the buggy. \nCan you tell me anything interesting about it? \nWere there any accidents incurred to this? since people actually in it?',1),(48,1271512835,'Future Freshman','Hong Kong','2014','Hi, i\'m a future freshman and i know very little about the buggy. \nCan you tell me anything interesting about it? \nWere there any accidents incurred to this? since people actually in it?',1),(49,1271512840,'Future Freshman','Hong Kong','2014','Hi, i\'m a future freshman and i know very little about the buggy. \nCan you tell me anything interesting about it? \nWere there any accidents incurred to this? since people actually in it?',1),(50,1271514311,'John Clayton','Massachusetts','Father of CMU freshman','Any chance you can wish my daughter Faith Clayton a happy birthday from mom and dad when she pushes?  (Fringe A woman\'s team, hill 5 I think)',1),(51,1271514835,'Marcos','San Francisco','Fringe 98','Are you able to put the clock on the top left of the screen?',1),(52,1271515427,'John Clayton','Massachusetts','Father of CMU freshman','Any chance you can wish my daughter Faith Clayton a happy birthday from mom and dad when she pushes?  (Fringe A woman\'s team, hill 5 I think)',1),(53,1271515436,'John Clayton','Massachusetts','Father of CMU freshman','Northboro, MA',1),(54,1271516207,'James McCormick','Italy','1982','Who makes the call on the SDC disqualification and isn\'t having former buggy drivers as chairs a little biased? It seems outrageous to nix a team of all their work this year.',1),(55,1271516286,'Merry K','Carnival booths','Future donor','Interesting to observe that none of the principles of good leadership were followed in making the decision to disqualify one of the teams for two years. Although your rules do not specify what constitutes \"near\" a truck, a decision was made in opposition to others in management roles. This clear abuse of power shows the danger posed to every team. The only real question is, was there malice?  Why donate to an org structure so prone to whim?',1),(56,1271517260,'Jungers','Brooklyn','97 Fringe','Can somebody restart the ustream feed? It seems to be all kinds of crappy for lots of folks right now (perfect for others, annoyingly).',1),(57,1271517644,'Jungers','Brooklyn','97 Fringe','So what is the heat order for Men\'s going to be?!',1),(58,1271517978,'OKA','MONTREAL','ZOO','GO ZOOOOOOOOOOOOOOOOO',1),(59,1271518046,'Josh Ayers','CMU','SDC 03','Do these races have any meaning with the dominant organization DQ\'d by an arbitrary decision making process?',1),(60,1271518049,'','','','How will the standings be determined if it starts raining now?',1),(61,1271518145,'Barry Gordon','Monte Sereno, CA','1969, 1971, PiKA','You keep on saying it chilly, but what is the temperature?',1),(62,1271518183,'Ronald Swager','Springfield, IL','\'72','When I attended CMU buggy races included \"funny\" cars and peddle-less bicycles.  Have these been eliminated by the rules, or has the technolgy just settled on the 4-wheel, face-first, belly-whopper?',1),(63,1271518209,'Zoo alum','Chute','1985','Estes, how many beers are you pounding later today?  ',1),(64,1271518343,'','','','Why was the SDC C team disqualified yesterday and not the Pika A team? It seems like another arbitrary decision against the team.',1),(65,1271519351,'Megan','Pittsburgh','2010 SDC','I\'m a new pusher for SDC this year, so have only recently witnessed the commitment and passion of our four-year mechanics, drivers, and team captains.  It was disappointing for me not to race today, but much more upsetting to see months of my teammates labor wasted due to a political call made by the sweepstakes chair.  If the CMU buggy organization is so supremely concerned about raceday safety, I would advise they shift focus from our (harmless) outdoor radiant heater and concern themselves with the lead and follow trucks.  Passengers which sit on edge of the truck bed or hang half their bodies out windows are at much greater risk of injury (not to mention a liability) than SDC pushers warming their hands by a radiant heater.  Perhaps this should be addressed to diffuse at least some of the hypocrisy of today\'s SDC disqualification?',1),(66,1271519782,'Anon','Carnival','','I overheard members of pika cheering the decision to disqualify sdc. Can you discuss whether or not karma is in fact a bitch?',1),(67,1271520079,'Spectator','Buggy','','  It is very sad for me to witness what buggy is turning into for some people.  After the very sad disqualification of SDC earlier this morning I realized how vengeful and hating some organizations have become.  The attempt at disqualifying a team and then cheering and celebrating the result by Pika is completely against the spirit of carnival.  Very sad day...',1),(68,1271520336,'JB','Ann Arbor MI','Pioneer 89','Pika gets a re-roll for an incident that has had no impact on their roll?',1),(69,1271520423,'Matthew','bed','SDC, 1999','BTW, you guys did a quality job broadcasting this year.',1),(70,1271520774,'JB','Ann Arbor MI','Pioneer 89','You keep talking about the cold being a factor.  Wasn\'t the \'88 spirit course record set on a cold (snowy?) day?',1),(71,1271520797,'Pika','','','Pika shall re-roll until they put in a non-shitty time. ',1),(72,1271521038,'OKA','MONTREAL','ZOO','GO ZOOOOOOOOOOOOOOOOO',1),(73,1271521039,'OKA','MONTREAL','ZOO','GO ZOOOOOOOOOOOOOOOOO',1),(74,1271521040,'OKA','MONTREAL','ZOO','GO ZOOOOOOOOOOOOOOOOO',1),(75,1271521040,'OKA','MONTREAL','ZOO','GO ZOOOOOOOOOOOOOOOOO',1),(76,1271521089,'Jason Caldeira','Chicago','','Nice work, Bordick!',1),(77,1271521987,'Lizzie Haldane','WW','2010','Is it possible to get a quote from the commentators in response to the SDC disqualification, for The Tartans\' issue on Monday? It would be great to have your input. We didn\'t want to intrude during the other races or final commentary. If possible, please email sports@thetartan.org or 914-522-3282 as we don\'t know how else to contact you. Thank you.',1),(78,1271521996,'Lizzie Haldane','WW','2010','Is it possible to get a quote from the commentators in response to the SDC disqualification, for The Tartans\' issue on Monday? It would be great to have your input. We didn\'t want to intrude during the other races or final commentary. If possible, please email sports@thetartan.org or 914-522-3282 as we don\'t know how else to contact you. Thank you.',1);
