INSERT INTO `newdata` VALUES (83,2,1223854209,'I believe \"Kritsten Williams\" should be \"Kristen Williams\" for safety chair 1998','i was there!','Janice Golenbock','jsg@alumni.cmu.edu','Safety Chair 1998 spelling'),(85,2,1223920287,'Mad Dog won the T-shirt award (a useless subjective category) in 1994.  Jason Caldeira was the designer. ','I was there. ','Bordick','abordick@comcast.net','T-shirt 1994'),(111,2,1223950402,'No \"h\" in my name. :) Thanks.','It\'s my name.','Sara Player','splayer@gmail.com','Sweepstakes chair \'05 spelling'),(112,2,1224019330,'I believe you should use the full name for any group in your history data base.  There appears to be pleanty of room.  \r\n\r\nI believe it was Sigma Nu who won in 82 and 85. I have no idea who \"signu\" is but I can\'t find them in the buggy book for 82 or 85.   If we are going to contract the names of the orgs, then please replace \"fringe\" with \"fige\"  and \"Spirit\" with \"Spit\".','i was there','Mark Estes','mark_estes@yahoo.com','overall comment'),(113,2,1224019830,'1981:  2nd place: Sigma Nu (2:14.2)\r\n1984:  1st place:  PiKA   (2:09.0) 2nd place: Beta Theta Pi (2:10.0),  3rd Place: Sigma Nu (2:11.0)  \r\n','i was there\r\n\r\nrevo edit: 1981 looks correct, 1984 data looks like 1983 to me, I have contacted Mark to see if it is just a typo on his part for the year','Mark C Estes','mark_estes@yahoo.com','old places'),(114,2,1224105340,'Dani Barnard\r\nSDC 1995-1997\r\nSweespstakes Chair 1998\r\n\r\nTo be added:\r\nSDC Women\'s B / 1995 / Hill 5 / Escargot\r\nSDC Women\'s A / 1996 / Hill 5  / Rage / 3rd Place\r\nSDC Women\'s B / 1997 / Hill 4\r\nSDC Support Chair 1997\r\n','me','Dani Barnard','dani_barnard@hotmail.com','Dani\'s info'),(115,2,1224175787,'Demani- 1997 1st Place Design\r\nFuko- 1996 Men\'s A DNF\r\nHaraka- 1998 Men\'s A 2:09.45 1st Place\r\nHaraka- 1995 Men\'s A 2nd Place\r\nHaraka- 1996 Women\'s A 1st Place\r\nHaraka- 1999 Men\'s A 2nd Place\r\nHaraka- 2008 Men\'s A 4th Place\r\nHaraka- 1995 1st Place Design\r\nHaraka- 1998 3rd Place Design\r\nShaka- 1992 Men\'s A 2.07.37 1st\r\nShaka- 1993 Men\'s A 2.10.43 1st\r\nShaka- 1994 Men\'s A 2nd\r\nShaka- 1996 Men\'s B 2nd\r\nShaka- 1992 1st Place Design\r\nVicious- 1990 Men\'s A 2nd Place\r\nVicious- 1991 Men\'s A 1st Place 2.10.63\r\nQL- 1988 Men\'s A 1st 2.06.20\r\nQL- 1989 Men\'s A 1st 2.06.57\r\nSting- 1987 Men\'s A 1st 2.11.35\r\n \r\nI think Haraka got 2nd place design in \'96, not sure.\r\n','Hate.','Carl Nott','carln@ccilabs.com','Spirit Stuff'),(116,2,1224200455,'In 1993, Terry Lacuesta was unable to qualify A team with Mach II.  The site shows that she was D team in Renegade which is not true.  I think we bumped Maverick up to A team, Desperado to B team and Renegade to C team.  \r\n\r\nAlso, if you trust me, I would be happy to just edit the Pika History for correctness.  Not sure if you can trust an Old Pike, but I wanted to offer to lighten your load.  I\'ve got lots of Wood\'s data that I could add to the Races section.','Totally there','bordick','abordick@comcast.net','1993 Pika'),(117,-1,1224267473,'Hehe, just having fun with the contribute format. ;)','I was SO THERE.','Carl Nott','nazdreg89@yahoo.com','Naked Pics of Dani'),(118,2,1224457535,'Sorry for Carl\'s abuse of this...I\'m assuming there were no actual naked pics of me...?','','Dani Barnard','dani_barnard@hotmail.com','Thanks a lot, Carl'),(119,2,1224463377,'1985 Day 1 time 2:09.05\r\n\r\nPush team\r\n\r\nDave (The Doctor) Bechtel\r\nScott Crump\r\nPete Orlic\r\nRoger Woodward\r\nRob Katz','wheel man zoo 84-88\r\n','Duane Delaney','duaned@4tpg.com','Zoo 1985 A time & team'),(188,2,1239210898,'When searching for the buggy \"Desperado\" the picture that comes up with it is actually \"Cyclone\"','There','Andy Bordick','abordick@comcast.net','Photo error'),(120,2,1224470300,'1998\r\nChairman\'s Choice: CIA\r\nSpirit of Buggy: Fringe\r\n\r\n','I was there, man.','Carsen','carsen@cmubuggy.org','Awards'),(121,2,1224560387,'Sorry, two corrections to my previous note \"Dani\'s info\"...\r\n\r\n1996 Women\'s A buggy was Sambvca (not Rage, apparently)\r\nAlso, I was SDC Support Chair in 1996 (not 1997)\r\n\r\nI know I must seem like an unreliable source now, but I swear this is correct:\r\n\r\n1996 SDC Women\'s A\r\nBuggy: Sambvca\r\nDriver: Julie Chen\r\nHill 1: Koshi Delaney-Karell\r\nHill 2: Celsea Marnell\r\nHill 3: Alexis Landeros\r\nHill 4: Melissa Sarko\r\nHill 5: Dani Barnard\r\nTime: ?\r\nPlace: 3rd\r\n','1996 post-Carnival Tartan and 1997 Buggy Book','Dani Barnard','dani_barnard@hotmail.com','1996 SDC Women\'s and corrections'),(122,2,1224603006,'CIA was awarded the Spirit of Buggy for 2002','I was CIA Chair and received award from Scott Wabnitz','Katherine Crawford','kfc@abtech.org','2002 Spirit of Buggy to CIA'),(123,2,1224708165,'2002 CIA Women\'s B Hill 4\r\n2003 CIA Assistant Chair\r\n2004 CIA Chair\r\n2004 CIA Women\'s B Hill 2\r\n2005 Sweepstakes Chair (this is already on the site, but for the sake of completeness it\'s here too:) )\r\n2006 Head Judge','I was there. :)','Sara Player','splayer@gmail.com','my various buggy roles'),(124,2,1224710747,'1983-6 Pusher, Pilam\r\n1984-6 Buggy Chairman, Pilam\r\n\r\nAlso, additional buggies - Pilam - Falcon (1981) and Miss Busweiser (1984)\r\n\r\nPilam  - Founded 1922(CMU chapter)','Me','Rich Spear','rdspear@hotmail.com','Multiple roles'),(125,2,1224726171,'I was Hill 1 pusher for Sigma Nu women\'s team in 1994. Our team consisted of all Kappa Alpha Thetas. I believe we set the record for the best time for any all-sorority team. Holley Anstatt East (Hill 2) was the push captain. I wrote a feature article about buggy in the Carnegie Mellon Alumni magazine that year. Ann Curran was the editor. Thank you!!!\r\n','myself','Carolyn Skarada Menke','menke@connecttime.net','1994 Sig Nu women\'s push team'),(126,2,1224733621,'Chair:\r\nRyan Sullivan\r\n\r\nBuggies:\r\nSpitfire\r\nVindicator\r\n\r\nDrivers:\r\nMindy Kipp\r\nJessica Messer\r\n\r\nMechanics (Main):\r\nBob Bruce\r\nKen Douglas\r\n\r\nMen\'s Push Team: \r\nSteve Maaseide\r\nDan Razum\r\nJim Kreiser\r\nAaron Long\r\nAndrew Johnke\r\nHollis Schuler\r\nJoe Cupani\r\nAdam Glass\r\nWes Shumaker\r\nSujit Bhattacharya\r\nJamie Eaton\r\n\r\nWomen\'s Push Team:\r\nCherie Hayek\r\nJeanel Noggle\r\nBobbie Marstellar\r\nAshli Thompson\r\nJen Gentry\r\nKim Loughran\r\nDebbie Anderson\r\nStephanie Miller\r\nEl Papageorgiou\r\nDawn Balazs','I was a driver, but this is from the 1993 Buggy Book','Jessica Lee-Messer','jleemesser@yahoo.com','Sigma Tau Gamma 1993'),(127,2,1224872093,'Hey!\r\n\r\nAWESOME website.  I love all the linking features-- sooooo cool!\r\n\r\nI noticed that Insite isn\'t receiving credit where it\'s due-- it was the buggy that helped Fringe\'s Women team claim victory in 2003!  I think the buggy listed is Bassketcase.\r\n\r\nAnd as if you don\'t already have enough to do... I\'m pretty sure you\'re probably aware I\'m split in two (Deming and Demming), but besides that, is it possible to add in that I was proud to be the Co-Push Captain for the 2005 and 2006 races?\r\n\r\nKeep up the great work\r\n\r\nAmanda','my ever so fond memories of Fringe buggy, oh and this: http://fringe.org/Pics/main.php?g2_itemId=25984','Amanda Deming','amanda.deming@gmail.com','2003 Womens Team A Buggy'),(128,2,1225154410,'Celerity won Design in 1998.  She also set our current house record of 2:11.60 on RD1 that year.  \r\n\r\nI\'m sure you have all the official times, but I have most of the PKT times back to 1994 if needed too.','i was there\r\n','wook','wook@thewook.com','PKT Data'),(129,2,1225165069,'Sam,\r\n\r\nThe winning mens team in 1966 was BETA and 1967 PIKA with a new course record of 2:24.8\r\nPika\'s winning time in 1968 was 2:20.9 first day and 2:22.5 second day.\r\nThe Delts did not win during the war years - there were three years that races were not held - 1943 through 1945.\r\nTop three teams back to 1946 available from PIKA Spreadsheet tab - also lists mos