'),(279,0,1258654232,'I attended CIT-->CMU from 1965 to 1969, during which time I was a driver for \r\nPhi Kappa Theta. I drove for practices in 1966 and drove Shamrock in the \r\nSweepstakes in 1967 and 1968. I believe we won 3rd one of those years. (I\'ve \r\ncopied Tom Kilgore, one of our chairman, for clarification).\r\n\r\nMy biggest to fame happened during a Sunday morning free roll practice in \r\n1969. Phi Kap had built an extra light buggy called Grey Ghost. At the \r\nbottom of the free roll, just before the bridge, the steering failed.  The \r\nbuggy went into the curb, my head first. I was taken to Presbyterian \r\nHospital and got 25 stitches in my forehead; if you look closely even today, \r\nyou can see a faint scar. Actually, I think the buggy design saved me from a \r\nconcussion; it hit the curb at an angle such that the light spoked wheel \r\nbent and absorbed much of the energy. For the rest of the spring, I went to \r\njob interviews with a big bandage on my forehead, and had to explain buggies \r\nto companies from here to California.\r\n\r\nNeedless to say, Grey Ghost never raced. In fact, one of pushers remembers \r\ntearing open the fiberglass to get me out.\r\n\r\nI believe the accident led to new safety requirements, including mandatory \r\nhelmets!\r\n\r\nMore recently, I have returned to CMU to interview graduates for jobs at \r\nHewlett-Packard (my last employer). When I tell them I was a driver, they \r\nlook at me quizzically. It seems all drivers now are little (mostly Asian) \r\nwomen. Well, I was 30 pounds lighter then!\r\n\r\nHope this helps. Feel free to contact me for more information.\r\n\r\nBob Arias','Myself','Bob Arias','arias22@comcast.net','PKT Buggy History 1965-1969'),(280,0,1259429643,'I was the safety chairman in 1978.  Previously had been a Beta buggy builder/designer of Echo.','It was me.','Michael Gibbs','mgibbs56@gmail.com','1978 Safety Chairman'),(358,0,1264117212,'Renegade was the buggy in the Pika 1991 Women\'s A Team.','I was the driver.','Darryn','darrynmiller@yahoo.com','1991 Women\'s A Team'),(434,0,1266777912,'Hill 1: Christine Anderson\r\nHill 2: Charlotte Jennings\r\nHill 3: Vicky Vargo\r\nHill 4: Danielle Millett\r\nHill 5: Mana Heshmati\r\n','I was there','Danielle Millett','dmillett@andrew.cmu.edu','SN 2008 women\\\'s A team'),(435,0,1266777933,'Hill 1: Katie Menzies\r\nHill 2: Christina Collura\r\nHill 3: Kami Hayden\r\nHill 4: Nadia Bosan\r\nHill 5: Alex Tronetti','I was there','Danielle Millett','dmillett@andrew.cmu.edu','SN 2008 women\\\'s B team'),(528,0,1288834601,'I am trying to reach my long lost sister. I have narrowed the search to the Buggy alumni and I am hoping you can get a message to her. I can be reached at jwilcoxpmp@yahoo.com. My sister is Jenetta Wilcox\r\n\r\nThanks in advance','','john wilcox','jwilcoxpmp@yahoo.com','my sister'),(437,0,1270216519,'See new photo sub-album I added into 1980\\\'s album. Includes debut of Miss Budweiser in 1984 (I was the driver). Also, Falcon (1982) photos from 1985 and 1986, and Legend (1984) placing 2nd in the design competition in 1984.','Photos and old buggy books','Bob Button','rob@ubutton.com','PiLam 1980 Buggies'),(438,0,1270486710,'On the 2004 race page, the dq\\\'s on 2nd day have place numbers for some reason. They seem to be in the correct order, at the end of the non-dq teams, but I figured they should be blank in the place column.\r\n\r\n2005: Seems to have the same problem as above in the 2nd day women\\\'s. In 1st day men\\\'s, I think SDC B should be moved down under SigEP A.\r\n\r\n2008: Same problem as above in men\\\'s 2nd day. Also, since these pages don\\\'t reflect heat order, I would change the notes on SDC A and PiKA A to the following:\r\n\r\nFor 1st day, SDC A (Broke 1988 Men\\\'s Course Record, Course Record until next day), PiKA A (Faster than 1988 Men\\\'s Course Record)\r\n\r\nFor 2nd day, PiKA A (Broke Course Record from previous day, Course Record until 2009), SDC A (Faster than Course Record from previous day)\r\n\r\nWhile the current notes (beat course record) are not actually incorrect, they do sort of implicate that that roll broke the record rather than just being faster than the already broken record.\r\n\r\nI\\\'ll let you know if I find anything else  ','','Carleton','dcarleton@sdcbuggy.org','some race history formatting stuff i noticed'),(439,0,1270920077,'Women\\\'s A 1995 time was the course record from 95-2002 (its noted in other places, so figured it would make sense to add that).\r\n\r\nSpirit won first place design in 1994.','I was there.','Mike Visconti','mike@freestanding.net','Spirit info 92-95'),(515,0,1271457108,'The 1993 buggy book lists Schadenfreude as debuting that year.','1993 buggy book','Mike Hurwitz','yourmother@fringe.org','Incorrect year for Schadenfreude'),(516,0,1271557826,'In the \\\"People\\\" section Kelsey Montgomery should be KELSI Montgomery for the 1995 and 96 PIKA teams.\r\nThanks for the great site!','Me','Kelsi Montgomery','kelsi@alumni.cmu.edu','name spelling correction'),(517,0,1271621708,'I\\\'m listed as 2 people currently-Rebecca Peterkin and Becky Peterkin. I\\\'m fine with either one, but right now the data associated with each name is different:\r\n\r\nRebecca Peterkin\r\n2009 Fringe Women\\\'s A Driver\r\n2010 Fringe Men\\\'s A Driver\r\n\r\nBecky Peterkin\r\n2010 Fringe Women\\\'s A Driver\r\n\r\nIs there a way to either combine/link both names? Or could they at least be updated to both include all the data? If I have to pick one name to be listed under I\\\'d pick Becky Peterkin, just because that\\\'s what I actually go by.','I know my name(s) is/are confusing, but there\\\'s still only 1 of me','Becky Peterkin','spryte.becky@gmail.com','the world doesn\\\'t really need 2 of me....'),(518,0,1271655574,'Wrong buggy, that roll was King of Spades both days. It was the second house record that KoS set.','I was on the truck.','Brett Zakeosian','baz@andrew.cmu.edu','SN Women\\\'s A 2009'),(519,